query postQuery(
  $slug: String!
) {
  contentfulPost(slug: {eq: $slug}) {
    title
    slug
    tagline {
      childMarkdownRemark {
        rawMarkdownBody
      }
    }
    body {
      childMarkdownRemark {
        html
      }
    }
  }
}

